Reaching my 2023 goals with @iherb 🤍

iHerb is one of my fave places to shop for all things wellness! Here are some products I’ve incorporated into my routine:

@organikahealth Enhanced Collagen: A great way to increase your collagen intake, which helps with hair, skin, nails, and gut health!

@thornehealth L-Glutamine Capsules: L-glutamine supports gastrointestinal health, wound healing, and your immune health! 

@grabgreen Three In One Laundry Pods:  Love that these pods are eco-friendly and that the brand is female-owned. The lavender vanilla scent is so good too!

@mrsmeyerscleanday Surface Cleaner: One of my absolute favourite brands with so many amazing scents and clean ingredients!

@biodermacanada Sensibio Micellar Water: I’ve been using this micellar water for years and it’s such a convenient addition to my routine. Love pairing this micellar water with reusable face rounds. 

@heritagestorenaturals Rosewater & Glycerin Facial Mist: Rose is one of my favourite skincare ingredients since it’s so hydrating and soothing. This mist adds such a beautiful finish to the skin too!

@herocosmetics Mighty Patch Original: Another favourite of mine for years! These are great for treating pimples and are especially helpful if you’re someone who picks at acne (aka me).

