My current hyperfixations:

@vichylaboratoires minéral 89: this has been one of my holy grail hyaluronic acid serums for years! The texture is super lightweight and sinks into the skin effortlessly. My fave way to add extra hydration to my AM and PM routines. 

@belifcanada moisturizing eye balm: my under-eye area always ends up so dry in the winter months but this eye cream has been a lifesaver! A little goes a long way and it feels super nourishing.

@lancomeofficial lash revitalizing serum: I feel like I’ve neglected my lashes for a while but I’m ready to give them some TLC! I’ve been loving this serum from Lancôme, formulated with HA, Cica, and amino acids to promote healthy lash growth. 

@genuinehealth deep sleep: your girl cracked a filling in her sleep from clenching and grinding her teeth all night … big wake up call! I’ve noticed melatonin and magnesium glycinate make a huge difference in the quality of my sleep and I haven’t had any jaw soreness in weeks! 

@therealsjmaas ACOTAR: cannot put this series down. I carry it with me everywhere I go at this point 

