a much-needed deep clean after a busy week of work and events ✨ I personally find cleaning super therapeutic thanks to these faves:

@simplehuman touch-free soap sensor pump: my man got this for me as a gift because he knows me so well and it’s my fave new home gadget. The battery lasts so I can go weeks between charges, and I love that you can control the amount that is dispensed based on where you swipe your hand! 

@tinecoglobal pure one S11 vacuum: toronto apartments get dusty really quickly, so a good vacuum is essential. I love this one because it’s cordless, easy to maneuver, and has a light up display to show you what areas of your floor need more attention!

@mrsmeyerscleandaycanada cleaning products: I’m trying to be more mindful of the cleaning products I use since a lot of them can be formulated with not-so-good things. I’m so obsessed with these cleaning products because they’re effective, they smell amazing, and they’re formulated with safe ingredients!

